import React from 'react';

function ChannelList({ channels, setCurrentChannel }) {
  return (
    <div className="channel-list">
      {channels.map(channel => (
        <div key={channel} onClick={() => setCurrentChannel(channel)}>
          {channel}
        </div>
      ))}
    </div>
  );
}

export default ChannelList;
